Okay, let's break down this ultimatum game scenario and build a computational model to predict responder behavior.

**1. Psychological Mechanisms:**

*   **Fairness/Inequity Aversion:** People dislike unequal outcomes. The stronger this aversion, the more likely they are to reject offers that are perceived as unfair, even if it means getting nothing. Key variables: `split_self`, `split_opp`, `combined_earning`, `token_self`, `token_opp`.
*   **Proposer Intentions/Trust:** Responders might infer the proposer's intentions based on the offer. A very low offer may be seen as intentionally unfair, leading to rejection. Key variables: `split_perc_opp`, `split_perc_self`, `proposed_perc`, `token_self`, `token_opp`.
*   **Loss Aversion:** The pain of losing something is stronger than the pleasure of gaining something of equal value. Rejecting a small offer can feel like a loss. Key variable: `split_self`.
*   **Anchoring/Reference Points:** Prior earnings or expectations could influence the perception of fairness. The tokens earned might set a reference point. Key variables: `token_self`, `token_opp`, `combined_earning`.

**2. Interactions:**

*   Fairness considerations are likely to be weighted by the total amount available. A £1 offer out of £10 is different from a £1 offer out of £2. `split_self` needs to be considered relative to `combined_earning`.
*   The relative contribution of the responder and proposer can also affect fairness judgments. If the responder found most of the tokens, they may be more sensitive to unfair splits. `token_self` and `token_opp` matter.
*   A loss aversion component might interact with the perceived fairness. A very unfair offer might be rejected even if the absolute amount offered is decent, because the unfairness amplifies the "loss" of the potential gain.

**3. Mathematical Form:**

I'll use a utility function to model the responder's decision. The utility will depend on a fairness term, an inequity aversion term, and a small noise term.

**4. Parameters:**

*   `alpha`: Sensitivity to disadvantageous inequity. The higher `alpha`, the more the responder dislikes getting less than the proposer.
*   `beta`: Sensitivity to advantageous inequity. The higher `beta`, the more the responder dislikes getting more than the proposer (guilt).
*   `delta`: Sensitivity to overall earnings.
*   `mu`: Noise parameter that determines the stochasticity.
*   `kappa`: The weighting of the total amount for fairness considerations
*   `lambda_param`: Weighting of relative token contribution.

**5. Model Variables and Observable Behavior:**

